
'use strict';

var ocrYoutu = require('./index').youtu;
var ocrAli = require('./index').ali;

var sfz1 = 'data:image/jpeg;base64,';
var params = {
  image: sfz1,
  //url: 'http://att.bbs.duowan.com/forum/month_0811/20081129_27966deeb83231a3ea4b2sxvOaowJfVN.jpg',
  card_type: 0,////0-1-
  session_id: ''
};

var sfz2 = 'data:image/jpeg;base64,';
var params2 = {
  image: sfz2,
  url: '',
  card_type: 1,////0-1-
  session_id: ''
};

var youtuTest = function () {
  //
  ocrYoutu.idCardOCR(params, function (err, result) {
    console.log('youtu:', err, {
      name: result.name,
      sex: result.sex,
      nation: result.nation,
      birth: result.birth,
      address: result.address,
      id: result.id
    });
  });

  //
  ocrYoutu.idCardOCR(params2, function (err, result) {
    console.log('youtu:', err, {
      valid_date: result.valid_date,
      authority: result.authority,
    });
  });
};

var aliTest = function () {
  ocrAli.idCardOCR([params, params2], function (err, result) {
    return console.log('ali:', err, result);
  });
};


youtuTest();
aliTest();